import React from "react";
import { Link } from "react-router-dom";
import { Icons } from '../images/Icons'

export default () => {
  return (
    <div className="home page-main__wrapper">
      <section className="left__img-container">
        <div className="section__container__wrapper">
          <img src={Icons.resume} alt="Icon" className="Home_Icon" />
          <div className="text__container">
            <h1 className="home__content-headline">Create a stands out portfolio</h1>
            <p className="home__content-paragraph">Build your digital portfolio with all you need to show potential employers what you are capable of.
            Education, Work experience and every detail the company needs to know about you as well as projects where you worked and teams you were part of.</p>
          </div>
        </div>
      </section>
      <section className="right__img-container">
        <div className="section__container__wrapper">
          <h1 className="home__content-headline"></h1>
          <p className="home__content-paragraph">Lorem ipsum dolor sit amet, consectetur adipisicing elit. Soluta impedit eveniet architecto error illum dolorem a incidunt minus deserunt distinctio, nostrum inventore veniam neque repudiandae alias in! Vitae, aliquid maiores.</p>
          <img src="" alt="Icon" className="Home_Icon" />
        </div>
      </section>
    </div>
  )
}

